import React from 'react';
import styled from 'styled-components';

function CardMaker(props) {
    const {team} = props
    return (
        <StyledCard>
            <div>
            {team.map(member => (
            <div>
                <h2>{member.name}</h2> 
                <h2>{member.name}</h2>
                <h2>{member.role}</h2>
                <h2>{member.email}</h2>
            </div>
            ))}
            </div>
        </StyledCard>
    )
}
const StyledCard = styled.div`
    box-shadow: 2px 2px 2px;
    border: lightgrey solid 1px;



`
export default CardMaker
